import { useStyles } from '../App';
import React, { Component } from 'react';
import Box from '@material-ui/core/Box';
import TimerIcon from '@material-ui/icons/Timer';
import data from '../MOCK_DATA.json';


export const TaskBubble = (type) => {
    //const data = state.userData;
    const classes = useStyles();
    const mapRows = data.filter((task) => task.type.includes(type)).map((item, index) => (

        <React.Fragment key={item.id}>
          <Box className={classes.taskBubble} style={{ backgroundColor: item.state }} onClick={console.log(item.id)}>
            <Box flexGrow={1}>
              <h3 className={classes.bubbleTitle}>{item.title}</h3>
            </Box>

            <TimerIcon style={{marginRight:'5px'}}/>
            <h3 className={classes.bubbleWorkTime}>{item.workTime}</h3>

          </Box>
        </React.Fragment>
    ));
    return mapRows;
  };
